{# This template will compare the values collected from netbox in orderModel.inventory with the response from the GNMI precheck call. It will prep the payload for the next step#}
{# default output "result".  Assume success unless failure is detected #}
{% set result = { "success" : true, "status": "success", "reason": "default" } %}
{% if not precheckResponse.notification[0]["update"][0].val %}
  {% set _=result.update({ "success" : false, "status": "failure", "reason": "empty result set from GNMI" }) %}
{% endif %}
{% set deployPayload = [
    [
      "openconfig-interfaces:interfaces",
{"interface":[{"name": orderModel.inventory.interfaceName,"config":{"mtu":orderModel.inventory.mtu,"description":orderModel.inventory.interfaceDescription,"name": orderModel.inventory.interfaceName},"openconfig-if-ethernet:ethernet":{"config":{"auto-negotiate":orderModel.inventory.autoNegotiate}}}]}
    ]
  ] %}
{%- set myOutput={ "result": result, "deployPayload": deployPayload } %}
{{- myOutput|tojson(indent=2) }}

